//material UI complete course
import {Button,Typography,IconButton, TextField, Link} from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import SendIcon from  '@mui/icons-material/Send';
import Fingerprint from  '@mui/icons-material/Fingerprint';

function Learn_mui() {
    return (
        <>
        {/* for heading paragraph (h1,h2,p etc) */}
            <Typography
                variant='h4'
                sx={{ color: 'red' }}
                component={'p'}
                m={3}
                mb={0}
                mt={15}
            >
                we are learning MUI
            </Typography>
            <br/><hr />

            {/* buttons */}

            <Typography variant='h4' m={2} sx={{ color: 'green', textAlign:'center' }}>buttons</Typography>

            <Button>click me</Button>
            <Button variant='contained'>click me</Button>
            <Button variant='text'>click me</Button>
            <Button variant='outlined'>click me</Button>
            <Button variant="contained" disableElevation>Disable elevation</Button>
            <Button disabled>Disabled</Button>
            <Button href="#text-buttons">Link</Button>
            <Button
                onClick={() => {
                    alert('clicked');
                }}
            >
                Click me
            </Button>

            <Button color="secondary" size="small">Secondary</Button>
            <Button variant="outlined" color="error" startIcon={<DeleteIcon />}> delete</Button>
            <Button variant="outlined" color="success" endIcon={<SendIcon />}> SEND</Button>

            <br /><hr />
            {/* icon btn */}

            <Typography variant='h4' m={2} sx={{ color: 'green', textAlign:'center' }}> icon buttons</Typography>
            
            <IconButton aria-label="delete"  color="warning" size='large'>
               <DeleteIcon fontSize='inherit'/>
            </IconButton>

            <IconButton aria-label="send"  color="success">
               <SendIcon />
            </IconButton>

            <IconButton aria-label="send"  color="secondary">
               <Fingerprint />
            </IconButton>

            <br/><hr />
            {/* link */}
            <Typography  variant='h4' m={2} sx={{ color: 'green', textAlign:'center' }}>Link</Typography>
            <Link
              variant='h4'
              href='https://www.facebook.com/'
              underline='hover'
              m={2}
            >facebook </Link>
             <Link
              variant='h4'
              href='https://www.facebook.com/'
              underline='none'
              m={2}
            >link2 </Link>
            <Link
              variant='h4'
              m={2}
              href='https://www.facebook.com/'
              underline='always'
            >link3 </Link>



            <br/><hr />


            {/* textfield like input */}
             
            <Typography variant='h4' m={2} sx={{ color: 'green', textAlign:'center' }}> Textfield like input </Typography>
 
            <TextField label='name' type='text' placeholder='name' sx={{margin:'20px'}} />
            <TextField  type='password' placeholder='password' variant='standard' sx={{margin:'20px'}}/>
            <TextField label='email' type='email' placeholder='email' variant='outlined' sx={{margin:'20px'}}/>
            <TextField  type='number' placeholder='number' variant='filled' sx={{margin:'20px'}}/>
            
            <br/><hr />

        </>
    )
}

export default Learn_mui;
